import styles from "./Portfoliohover.module.css"
import buddiz from "../assets/버디.jpg"
function Portfoliohover({setBuddizClick}){
    console.log(setBuddizClick);
    const del = () =>{
        setBuddizClick(false)
    }
    return(
        <>
        <div className={styles.container}>
            <img src={buddiz} alt=""/>
        </div>
            <button className={styles.button} onClick={del}>삭제</button>
        </>
    )
}

export default Portfoliohover;
